async () => {
  return Reset_password_Api.run().then(data => {
    showAlert(data.message, 'success');
    clearStore();
    navigateTo('StartingPage');
  }).catch(error => {
    if (Reset_password_Api.data.message === undefined) {
      showAlert('Too many attempts, SignIn after sometimes', 'warning');
      navigateTo('StartingPage');
    } else showAlert(`${Reset_password_Api.data.message}`, 'error');
  });
}
